import axios from "axios";
import React, { useEffect, useState } from "react";
import _ from "lodash";
import { useHistory } from "react-router";
import { useDispatch, useSelector } from "react-redux";
import { showAction } from "./reducer/video";

function Home(props) {
  const [data, setData] = useState([]);
  const [search, setSearch] = useState("");
  const [result, setResult] = useState([
    {
      title: "sss",
      src: "https://www.youtube.com/embed/vBveYjol2lI",
      description: "ss",
    },
  ]);

  let history = useHistory();
  const dispatch = useDispatch();
  const state = useSelector((state) => {
    return { video: state.video.video };
  });
  const fetchApi = async () => {
    const data = await axios.get(
      "https://youtube.googleapis.com/youtube/v3/videos?part=player&chart=mostPopular&maxWidth=200&key=AIzaSyDGfgHu5xMnVzAtjs1bYgWGYYUF6yA8dXg"
    );
    setData(
      data.data.items.map((e) => "https://www.youtube.com/embed/" + e.id)
    );
  };

  const searchApi = _.debounce(async () => {
    const key = await axios.get(
      `https://youtube.googleapis.com/youtube/v3/search?part=snippet&maxResults=5&q=${search}&key=AIzaSyAfMOsMbcN-coXJABWbYRwK5lf_lJDHNRc`
    );
    console.log("this is your data",key.data)

    setResult([{
      title: key.data.items.snippet.title,
      src: key.data.items,
      description:key.data.items.map((e)=>e.snippet.description)
    }]);
    console.log("this is me"+result)
  }, 500);



  useEffect(() => {
    // fetchApi();

  }, []);

  return (
    <div>
      <h1>Youtube Website</h1>
      <h4>Search</h4>
      <input
        type="text"
        value={search}
        onChange={(e) => setSearch(e.target.value)}
      />

      <button onClick={() => (searchApi(),  dispatch(showAction(result)))}>Search</button>

      <div className="continer">
        {data.map((e, i) => (
          <div key={i}>
            <iframe
              width="400"
              height="213"
              src={e}
              frameBorder="0"
              allow="accelerometer; autoplay; 
              clipboard-write; encrypted-media; gyroscope;
              picture-in-picture"
              allowFullScreen
            />
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
